import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  margin: 0 0 0 250px;
  height: 50px;
`;

const Logo = styled.div`
  float: left;
`;

const Form = styled.form`
  float: left;
  margin-top: 5px;
  margin-left: 20px;
`;

const Input = styled.input`
  width: 600px;
  height: 40px;
  border-radius: 5px;
  font-size: 22px;
  border: 0px solid;
`;

const DonHangDiv = styled.div`
  font-size: 14px;
  color: #fff;
  display: block;
  text-align: center;
  width: 64px;
  height: 50px;
  float: left;
`;

const TopHead = () => {
  return (
    <Container>
      <Logo>
        <img src="../static/logo.png" alt="logo" width="50px" height="50px" />
      </Logo>
      <Form>
        <Input />
      </Form>
      <DonHangDiv>Đơn Hàng Của Bạn</DonHangDiv>
    </Container>
  );
};

export default TopHead;
